ll_type":"markdown","id":"f0dce3eb","metadata":{"papermill":{"duration":0.01786,"end_time":"2024-09-12T01:06:52.536912","exception":false,"start_time":"2024-09-12T01:06:52.519052","status":"completed"},"tags":[]},"source":["![image.png](attachment:13ac9516-1edf-40fa-8bb9-8fe14e4330c0.png)\n","\n","#### The total number of all rides does not have significant differences during the whole week with the highest days being Tuesday and Wednesday and the lowest days being Saturday and Sunday. For the annual members, the highest day is Tuesday, and the lowest day is Sunday. For the casual riders, the highest day is Thursday, and the lowest day is Monday."]},{"cell_type":"markdown","id":"a947fc6f","metadata":{"papermill":{"duration":0.017618,"end_time":"2024-09-12T01:06:52.572313","exception":false,"start_time":"2024-09-12T01:06:52.554695","status":"completed"},"tags":[]},"source":["## 3.5 - Share Phase \n","### (Sharing the findings, insights, and recommendations with the stakeholders, in this case, the director of marketing)\n","Prepared a presentation with data visualizations and recommendations, with the below conclusion:\n","\n","#### Recommendation 1:\n","> Finding:\n","Although Casual Riders account for only 9% of the total rides; however, they account for 39% of the trip durations and the average trip duration by the casual riders is almost 6 times higher than that of the annual members.\n","\n","> Insight:\n","Since the fares are paid by duration and not by ride, the value of business that casual riders are bringing is higher than the annual members, even though the number of rides by casual riders are way less than the annual members.\n","\n","> Recommendation:\n","Prepare a marketing campaign to target new clients.\n","\n","#### Recommendation 2:\n","> Finding:\n","The number of rides by annual members during the week are less than the weekends.\n","The average trip duration by annual members during the week is less than the weekends.\n","\n","> Insight:\n","The difference in use of the bikes throughout the week shows that Annual members use Cyclist bikes to commute to work or school.\n","\n","> Recommendation:\n","Prepare a marketing campaign to target students and employees\n","\n","#### Recommendation 3:\n","> Finding:\n","The number of rides by casual riders are almost the same during the week, except on Thursday.\n","The average trip duration by casual riders during the week is less than the weekends, except on Thursday.\n","\n","> Insight:\n","Thursdays have the most rides and trip durations for casual riders. None of those Thursdays were a public holiday.\n","Casual riders’ behavior are unpredictable.\n","\n","> Recommendation:\n","Need to study more data to better understand casual riders’ behaviors\n","\n","#### Based on the findings above, it is important to prepare an advertising campaign to target casual riders into becoming annual members, but it is as important to prepare a marketing campaign to target non-riders.  "]},{"cell_type":"markdown","id":"d704e2b5","metadata":{"papermill":{"duration":0.017502,"end_time":"2024-09-12T01:06:52.60738","exception":false,"start_time":"2024-09-12T01:06:52.589878","status":"completed"},"tags":[]},"source":["## 3.6 -  Act Phase \n","### (Acting on the recommendations)\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5638904,"sourceId":9310920,"sourceType":"datasetVersion"},{"datasetId":5682666,"sourceId":9369972,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":266.332723,"end_time":"2024-09-12T01:06:52.746964","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__not